Post request on Mongoose does not match with Get request<p>what is stored on my MongoDB Atlas does not match with my post request. Only the username is stored in my database, despite having a tweet and date in the post request and the schema. How do i get the tweet and date to show in my database? Thanks!</p>

<p>MONGODB Schema: </p>

<pre><code>const mongoose = require("mongoose");

const Schema = mongoose.Schema;

const tweetSchema = new Schema(
  {
    username: {
      type: String,
      required: true
    }
  },
  {
    tweet: {
      type: String,
      required: true,
      maxlength: 140
    }
  },
  {
    date: {
      type: Date,
      required: true
    }
  },
  {
    timestamps: true
  }
);

const Tweet = mongoose.model("Tweet", tweetSchema);

module.exports = Tweet;
</code></pre>

<p>express router: </p>

<pre><code>const router = require("express").Router();
let Tweet = require("../models/tweet.model");

router.route("/").get((req, res) =&gt; {
  Tweet.find()
    .then(tweet =&gt; res.json(tweet))
    .catch(err =&gt; res.status(400).json("Error: " + err));
});

router.route("/add").post((req, res) =&gt; {
  const tweet = req.body.tweet;
  const username = req.body.username;
  const date = Date.parse(req.body.date);

  const newTweet = new Tweet({
    username,
    tweet,
    date
  });

  newTweet
    .save()
    .then(() =&gt; res.json("Tweet added!"))
    .catch(err =&gt; res.status(400).json("Error: " + err));
});

module.exports = router;
</code></pre>

<p>post request:</p>

<pre><code>{
    "username": "yourfatuncle",
    "tweet": "first tweet",
    "date": "2020-03-19T08:28:49.271+00:00"
}
</code></pre>

<p>get request: </p>

<pre><code> {
        "_id": "5e6f48d349a86510646354ae",
        "username": "yourfatuncle",
        "__v": 0
    }
</code></pre>

