mongodb Aggregation Pipeline to create a list of values from multiple nested document properties<p>I have two collections, db.items and db.data, in the following format:</p>

<pre><code>// db.items document (configuration-level information such as name, settings, user, etc.)
{
    _id: #id,
    ...
}

// db.data document (data for the a configuration)
{
    ...,
    item: #id, // reference to _id of db.item doc
    grouping_1: [
        { name: "A", item: "ObjectId()" },
        { name: "B", item: "ObjectId()" }
    ],
    grouping_2: [
        { name: "C", item: "ObjectId()" },
        { name: "D", item: "ObjectId()" }
    ]
}
</code></pre>

<p>What I can't seem to figure out is how to use the <a href="https://docs.mongodb.com/manual/tutorial/update-documents-with-aggregation-pipeline/" rel="nofollow noreferrer">Aggregation Pipeline</a> to feed a db.item doc a list of the db.data "name" props.</p>

<pre><code>// db.items document desired result
{
    _id: #id,
    names: ["A", "B", "C", "D"],
    ...
}
</code></pre>

<p>Queries such as <code>db.data.find( { item: #id }, { _id: 0, "grouping_1.name": 1, "grouping_2.name": 1 } )</code> for some reason return sets like this <code>{ "grouping_1": [ { "name": "A" }, { "name": "B" } ], "grouping_2" : [ { "name": "C" }, { "name", "D" } ] }</code></p>

<p><strong>I would prefer to see the implementation using both the shell and C# driver (2.10); however, if you can only provide one/that's too much to ask for I'll happily accept either one.</strong></p>

<p>Edit:
I was thinking restructuring my schema to be something like this would possibly make more sense/be easier to work with.</p>

<pre><code>{
    ...,
    grouping_1: {
        "A": "ObjectId()",
        "B": "ObjectId()"
    },
    grouping_2: {
        "C": "ObjectId()",
        "D": "ObjectId()"
    }
}
</code></pre>

<p>Edit 2:
For anyone who has a schema like i suggested in the first edit, <a href="https://mongoplayground.net/p/ED6WUjWhDOH" rel="nofollow noreferrer">here's the solution</a>!</p>

