Mongodb Update Elements from Multiple Arrays on a Document<p>I'd like to update a property from objects located in multiple lists on a MongoDB collection's document.</p>

<p>In a MongoDB collection I have documents like this one:</p>

<pre><code>{
    "firstArray": [
        {
        "name": "john",
        "updated": false // I wanna switch that to true
        },
        {
        "name": "bob",
        "updated": false
        }
    ],
    "secondArray": [
        {
        "name": "eric",
        "updated": false
        },
        {
        "name": "john",
        "updated": false // I wanna switch that to true
        }
    ]
}
</code></pre>

<p>My goal is to update every element with <code>"name":"john"</code> from document's properties <code>firstArray</code> and <code>secondArray</code> to <code>updated:true</code>.</p>

<p>As they can be parallel accesses to a document, I shall only use <a href="https://docs.mongodb.com/manual/reference/operator/update/#id1" rel="nofollow noreferrer">update operators</a> (a read and replace method <a href="https://stackoverflow.com/a/20601288/4973023">like that one</a> would add the risk of dropping changes made by another process)</p>

<p>It looks like the <a href="https://docs.mongodb.com/manual/reference/operator/update/positional-filtered/" rel="nofollow noreferrer">filtered positional operator $[]</a> as mentioned in <a href="https://stackoverflow.com/a/46054172/4973023">that question</a> is the way to go to update an object's property from a document's Array <strong>BUT</strong> it appears that <em>it doesn't support multiple <code>$set</code> with the same operator</em> nor <em>using two operators (one by array) in two different <code>$set</code></em>!</p>

<p>As this mongo shell command only update the <code>secondArray</code>:</p>

<pre><code>    db['collection'].update(
    {},
    {
        "$set": { "firstArray.$[elem].updated": true },
        "$set": { "secondArray.$[elem].updated": true }
    },
    { "arrayFilters": [{ "elem.name": "john" }], "multi": true })
</code></pre>

<p>And this command returns <code>The array filter for identifier 'a' was not used in the update { $set: { secondArray.$[b].updated: true } }</code>:</p>

<pre><code>    db['collection'].update(
    {},
    {
        "$set": { "firstArray.$[a].updated": true },
        "$set": { "secondArray.$[b].updated": true }
    },
    { "arrayFilters": [{ "a.name": "john" }, { "b.name": "john" }], "multi": true })
</code></pre>

<p>So, would you have any idea how to do that update? (Bonus point for any documentation quotes about the above limitations )</p>

<p>Thanks!</p>

