Mongoose - When returning all items from a collection (with no search param) the returned items from the collection do not contain their mongo _id<p>I am having a bit of an issue with Mongoose/MongoDB this afternoon. I have a situation where I need to return all items from a collection, and doing so means that I do not pass in any search params to <code>mongoose.find()</code>.</p>

<p>This is the controller that handles the get all request:</p>

<pre><code>exports.get_all_posts = async (req, res, next) =&gt; {
  const { params } = req;
  const { sortby } = params;

  //Sortby param takes two arguments for now: most_recent, oldest
  try {
    const getAllPosts = await BlogPost.find({}, { _id: 0 });

    console.log(getAllPosts);

    if (!getAllPosts) throw new Error('Could not get blog posts.');

    res.json({
      posts: date_.sort(getAllPosts, sortby)
    });
  } catch (error) {
    next(error);
  }
};
</code></pre>

<p>This is particularly where I think the issue is coming from:</p>

<pre><code>const getAllPosts = await BlogPost.find({}, { _id: 0 });
</code></pre>

<p>I am passing an empty search parameter and then removing the <code>_id</code> so that it doesn't throw an error telling me that I need to provide the <code>_id</code>.</p>

<p>However I still need to be able to pull in all of the posts. My items from this collection return as normal, just without their <code>_id</code>'s. </p>

<p>Here is my model for the blog posts:</p>

<pre><code>const mongoose = require('mongoose');

const BlogPostSchema = new mongoose.Schema({
  date: {
    type: Date,
    required: true
  },
  title: {
    type: String,
    required: true
  },
  author: {
    type: String,
    required: true
  },
  likes: {
    type: Number,
    required: false
  },
  post_body: {
    type: String,
    required: true
  },
  description: {
    type: String,
    required: true
  },
  tags: [
    {
      type: String,
      required: false
    }
  ],
  featuredImage: {
    type: String,
    required: false
  },
  draft: {
    type: Boolean,
    required: true
  }
});

module.exports = mongoose.model('BlogPost', BlogPostSchema);
</code></pre>

<p>One thing to note is that I have not defined an <code>_id</code>. Mongoose automatically adds in the <code>_id</code> field before saving a schema, so I think it is okay without it, as it has been in the past. </p>

<p>Thanks in advance for reading and any input!</p>

