How to use Mongo Auditing and a UUID as id with Spring Boot 2.2.x?<p>I would like to have Documents stored with an UUID id and createdAt / updatedAt fields. My solution was working with Spring Boot 2.1.x. After I upgraded from Spring Boot 2.1.11.RELEASE to 2.2.0.RELEASE my test for MongoAuditing failed with <code>createdAt = null</code>. What do I need to do to get the createdAt field filled again?</p>

<p>This is not just a testproblem. I ran the application and it has the same behaviour as my test. All auditing fields stay null.</p>

<p>I have a Configuration to enable MongoAuditing and UUID generation:</p>

<pre><code>@Configuration
@EnableMongoAuditing
public class MongoConfiguration {
    @Bean
    public GenerateUUIDListener generateUUIDListener() {
        return new GenerateUUIDListener();
    }
}
</code></pre>

<p>The listner hooks into the <code>onBeforeConvert</code> - I guess thats where the trouble starts.</p>

<pre><code>public class GenerateUUIDListener extends AbstractMongoEventListener&lt;IdentifiableEntity&gt; {
    @Override
    public void onBeforeConvert(BeforeConvertEvent&lt;IdentifiableEntity&gt; event) {
        IdentifiableEntity entity = event.getSource();
        if (entity.isNew()) {
            entity.setId(UUID.randomUUID());
        }
    }
}
</code></pre>

<p>The document itself (I dropped the getter and setters):</p>

<pre><code>@Document
public class MyDocument extends InsertableEntity {
    private String name;
}


public abstract class InsertableEntity extends IdentifiableEntity {
    @CreatedDate
    @JsonIgnore
    private Instant createdAt;
}

public abstract class IdentifiableEntity implements Persistable&lt;UUID&gt; {
    @Id
    private UUID id;

    @JsonIgnore
    public boolean isNew() {
        return getId() == null;
    }
}
</code></pre>

<p>A complete minimal example can be find here (including a test) <a href="https://github.com/mab/auditable" rel="nofollow noreferrer">https://github.com/mab/auditable</a>
With 2.1.11.RELEASE the test succeeds with 2.2.0.RELEASE it fails.</p>

